import React from 'react';
import form from '../Form';
import styled from 'styled-components';

const enterpreneur = () => {
  const StyledForm = styled.form`
    display: flex;
    flex-direction: column;
    justify-content: space-around;
  `;

  return (
    <StyledForm>
      <h4>Список реквизитов для индивидуальных предпринимателей</h4>
      <label>ИП ФИО
        <input type="text" inputMode="text" required placeholder="ИП Иванов Иван Иванович"></input>
      </label>
      <label>ИНН
        <input type="text" inputMode="text" required placeholder="7778644521"></input>
      </label>
      <label>ОГРНИП
        <input type="text" inputMode="text" required placeholder="1076564644123"></input>
      </label>
      <label>Юридический адрес
        <input type="text" inputMode="text" placeholder="129123, г. Москва, ул. Маломосковская, д. 12, стр.4." required></input>
      </label>
      <label>Номер телефона
        <input type="text" inputMode="text" placeholder="79031577557" required></input>
      </label>
    </StyledForm>
  );
};

export default enterpreneur;
